import axios from "axios";
import React, { useState, useEffect } from "react";
import { Table } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import "./user_detail.css";

function User_detail() {
  const [user, setUser] = useState([]);
  const navigate = useNavigate();
  const user_data = JSON.parse(localStorage.getItem("user_data"));

  useEffect(() => {
    // console.log(user[1].created_at)
    axios
      .get("http://localhost:8000/tracenet_user/", {
        headers: {
          "Content-Type": "application/json",
          Authorization: `Token ${user_data.key}`,
        },
      })
      .then((customers) => {
        console.log(customers.data);
        setUser(customers.data);
      });
  }, []);

  const handleClick = (data, e) => {
    let url = "http://localhost:8000/tracenet_user/" + data.id;
    if (e.target.value == "Login") {
      console.log(data);
      navigate("/dashboard/tracenet", { state: data });
    } else if (e.target.value == "Update") {
      navigate("/dashboard/");
      //   axios
      //     .post(url, {
      //       headers: {
      //         "Content-Type": "application/json",
      //         Authorization: `Token ${user_data.key}`,
      //       },
      //     })
      //     .then((res) => {
      console.log(data);
      // });
    } else {
      {
        window.confirm("Are you sure you want to delete ?")
          ? axios
              .delete(url, {
                headers: {
                  "Content-Type": "application/json",
                  Authorization: `Token ${user_data.key}`,
                },
              })
              .then((res) => {
                let filterData = user.filter((item, key) => {
                  console.log(item.id, data.id);
                  return item.id != data.id;
                });
                setUser(filterData);
              })
              .catch((err) => console.log(err))
          : console.log("false");
      }
    }
  };

  return (
    <div className="content-wrapper">
      <div className="card">
        <div className="card-header">
          <h3 className="card-title">Tracenet Users</h3>
          <div className="card-tools">
            <ul className="pagination pagination-sm float-right">
              <li className="page-item">
                <a className="page-link" href="#">
                  «
                </a>
              </li>
              <li className="page-item">
                <a className="page-link" href="#">
                  1
                </a>
              </li>
              <li className="page-item">
                <a className="page-link" href="#">
                  2
                </a>
              </li>
              <li className="page-item">
                <a className="page-link" href="#">
                  3
                </a>
              </li>
              <li className="page-item">
                <a className="page-link" href="#">
                  »
                </a>
              </li>
            </ul>
          </div>
        </div>
        <div className="card-body p-0">
          <table className="table">
            <thead>
              <tr>
                <th style={{ width: 10 }}>#</th>
                <th>Task</th>
                <th>Progress</th>
                <th style={{ width: 40 }}>Label</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>1.</td>
                <td>Update software</td>
                <td>
                  <div className="progress progress-xs">
                    <div
                      className="progress-bar progress-bar-danger"
                      style={{ width: "55%" }}
                    />
                  </div>
                </td>
                <td>
                  <span className="badge bg-danger">55%</span>
                </td>
              </tr>
              <tr>
                <td>2.</td>
                <td>Clean database</td>
                <td>
                  <div className="progress progress-xs">
                    <div
                      className="progress-bar bg-warning"
                      style={{ width: "70%" }}
                    />
                  </div>
                </td>
                <td>
                  <span className="badge bg-warning">70%</span>
                </td>
              </tr>
              <tr>
                <td>3.</td>
                <td>Cron job running</td>
                <td>
                  <div className="progress progress-xs progress-striped active">
                    <div
                      className="progress-bar bg-primary"
                      style={{ width: "30%" }}
                    />
                  </div>
                </td>
                <td>
                  <span className="badge bg-primary">30%</span>
                </td>
              </tr>
              <tr>
                <td>4.</td>
                <td>Fix and squish bugs</td>
                <td>
                  <div className="progress progress-xs progress-striped active">
                    <div
                      className="progress-bar bg-success"
                      style={{ width: "90%" }}
                    />
                  </div>
                </td>
                <td>
                  <span className="badge bg-success">90%</span>
                </td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>

      {/* <Table striped bordered hover ons>
          <thead>
            <tr>
              <th>User_id</th>
              <th>Username</th>
              <th className="table_head">Password</th>
              <th>Active Status</th>
              <th>Created at</th>
              <th>Updated At</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {user.map((item, key) => (

              <tr>
                <td>{item.id}</td>
                <td>{item.tracenet_username}</td>
                <td className="table_data">{item.tracenet_password}</td>
                <td>{String(item.is_active)}</td>
                <td>{new Date(item.created_at).toISOString().split("T")[0]}</td>
                <td>{new Date(item.updated_at).toISOString().split("T")[0]}</td>
                <td>
                  <div className="btn-group">
                    <button
                      type="button"
                      className="btn btn-default"
                      value={"Login"}
                      onClick={(e) => handleClick(item, e)}
                    >
                      Login
                    </button>
                    <button
                      type="button"
                      className="btn btn-default"
                      value={"Delete"}
                      onClick={(e) => handleClick(item, e)}
                    >
                      Delete
                    </button>
                    <button
                      type="button"
                      className="btn btn-default"
                      value={"Update"}
                      onClick={(e) => handleClick(item, e)}
                    >
                      Update
                    </button>
                  </div>
                </td>
              </tr>
            ))}
          </tbody>
        </Table> */}
    </div>
  );
}

export default User_detail;
